      </div>
    <div class="container">
    <div class="row">
      <div class="col-lg-4">
        <p className='maintext'>Website under construction</p>
        <p>Our Website is currently being build by the experts. We will be published shortly. Thank you for your patience.</p>
        <button onClick={() => window.location = 'mailto:yourmail@domain.com'}>Contact Me</button>
      </div>
      <div class="col-lg-8">
        One of three columns
        <img src={logo} alt="Logo" />;
      </div>
    </div>
  </div>
  </div>
  );
}

export default App;
